import React from 'react';

const Footer = () => {
    const Year = new Date().getFullYear()
    return(
        <>
           <footer class="footer mt-auto bg-yellow">
                <div class="container">
                    <span class="text-muted">@ {Year}</span>
                </div>
            </footer> 
        </>
    )
}

export default Footer;
